import './App.css';
import { Switch, Route, Router } from 'react-router-dom'

function App() {
    return (
        <div className="App">
            <Switch>
                <Route exact path="/">
                    <Home />
                </Route>
                <Route path="/students">
                    <Students />
                </Route>
                <Route path="/students">
                    <Students />
                </Route>
            </Switch>
        </div>
    );
}

export default App;
